import './footer.css';
function Footer(){
    return(
        <div className="footer-container">
            <div className="socials">
                <h2>CodeAhead</h2>
                <label>Visit us at:</label> <br />
                <img src="/images/footer/twitter.jpg" />
                <img src="/images/footer/Instagram-Icon.png" />
                <img src="/images/footer/twitter.jpg" />
            </div>
        </div>
    );
}

export default Footer;
